import React, { Component} from 'react';

export default class HomeContent extends Component{
  render() {
    return (
    <div>ffff
This projects aims at helping visually impaired people. The biggest problem of many blind people is the inability of the todays medicine to help them to see. The goal of this software is to create something which I call 'robot vision' that is electronic eyes which can recognize the surrounding world, people, cars, trees, buildings etc. and voice them. A blind person will wear electronic glasses connected to neural network
</div>
)
  }
}
